import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';

export function RequestForm() {
    return(
        <div>
            <p class="display-5">Lizingo forma:</p>
            <p>Užpildykite šią formą ir laukite mūsų atsakymo. Peržiūrėję jūsų užklausą, pakeisime paraiškos statusą <strong>Paraiškos</strong> skiltyje</p>

            <Form>
                <Form.group controlId="something">

                </Form.group>
            </Form>
        </div>
    );
}
